import React, { useEffect } from 'react';
import Logo from '../assets/images/logo.png';
import '../assets/css/Navbar.css';
import { Link } from 'react-router-dom';


function Navbar() {
    useEffect(() => {
        const handleScroll = () => {
            const header = document.querySelector(".App-header");
            if (header) {
                header.style.backgroundColor = window.scrollY > 0 ? "rgba(50, 50, 55, 0.5)" : "transparent";
                header.style.backdropFilter = window.scrollY > 0 ? "saturate(180%) blur(10px)" : "none";
                header.style.WebkitBackdropFilter = window.scrollY > 0 ? "blur(10px)" : "none";
            }
        };

        window.addEventListener("scroll", handleScroll);

        return () => {
            window.removeEventListener("scroll", handleScroll);
        };
    }, []);

    return (
        <div className="App-header">
            <div className="App-logo">
                <Link to="/dashboard">
                    <img  src={Logo} alt="Logo" width={100} />
                </Link>
            </div>
            <div className="App-menu">
                <ul />
                    <Link to="App-about"><li>About</li></Link>
                    <Link to="App-guidelines"><li>Guidelines</li></Link>
                    <Link to="App-domains"><li>Domains</li></Link>
                    <Link to="App-contact"><li>Contact</li></Link>
            </div>
        </div>
    );
}

export default Navbar;
